@ESatiro27 No, credo che capisca molto male. 
Il popolo conta eccome e in molte situazioni anche il singolo voto fa la differenza, vedi catasto. 
Basta non commettere l'errore di credersi "il popolo". Siamo in democrazia, ci si esprime con i voti e a volte i voti non vanno come vorremmo.

